import { Header, Icon, Button } from "semantic-ui-react";

export const NewNadeGfycatPlaceholder = () => {
  return (
    <>
      <Header icon>
        <Icon name="image" />
        Gfycat
      </Header>
      <br />
      <Button primary>Add</Button>
    </>
  );
};
